import React, { useState, useEffect } from 'react';
import {Navbar, Nav, Container, Button} from 'react-bootstrap';
import 'bootstrap/dist/css/bootstrap.min.css';
import styled from "styled-components";
import {useNavigate} from 'react-router-dom';
import logo from '../imgs/logo.png';

const Navigate = () => {
    const navigate = useNavigate();

    const MainButton = () => {      //로고 클릭시 메인페이지 이동
        navigate("/");
    }

    const handleLogin = () => {
    };

    const handleSignUp = () => {
    };

    return (

        <Navbar fixed="top" style={{ position: "fixed", backgroundColor: "white", boxShadow: "1.5px 1.5px 1.5px 1.5px #F3F4F6", width: "100%", zIndex: "1000" }}>
            <NavContainer>
                <Navbar.Brand onClick={MainButton}>
                    
                    <LogoImg alt="Logo" src={logo} />
                </Navbar.Brand>
                <div>
                    <Button variant="outline-primary" onClick={handleLogin} style={{ marginRight: '0.5rem' }}>로그인</Button>
                    <Button variant="primary" onClick={handleSignUp}>회원가입</Button>
                </div>
            </NavContainer>
        </Navbar>
    )
}

const NavContainer = styled.div`
  display: flex;
  justify-content: space-between;
  align-items: center;
  width: 100%;
  padding: 0 1rem; 
  height: 10vh;
`;

const LogoImg = styled.img`
  height: 10vh;
  width: auto; 
  cursor: pointer;
`;

const UserImg = styled.button`
  background: none;
  border: none;
  cursor: pointer;
`;



export default Navigate;
